import React, { useState, useEffect } from 'react';

function CatsImages() {
  const [catImages, setCatImages] = useState([]);

  useEffect(() => {
    fetchCatImages();
  }, []);

  const fetchCatImages = async () => {
    try {
      const response = await fetch('https://api.thecatapi.com/v1/images/search?limit=10', {
        headers: {
          'x-api-key': 'live_Kg8HqvTiYpHdztHFk3w6RiVaptksun4cHmjtX90wKZ6qVKz1ZZ47wNizOntIlACC'
        }
      });
      if (!response.ok) {
        throw new Error('Błąd pobierania danych');
      }
      const data = await response.json();
      setCatImages(data);
    } catch (error) {
      console.error('Błąd pobierania obrazów kotów:', error);
    }
  };

  return (
    <div>
      <h1>Obrazy kotów</h1>
      <div className="cat-images">
        {catImages.map((catImage, index) => (
          <img key={index} src={catImage.url} alt={`Kot ${index + 1}`} />
        ))}
      </div>
    </div>
  );
}

export default CatsImages;
